import React from 'react';
import { AppBar, Toolbar, Typography } from '@mui/material';

const Navbar = () => {
    return (
        <AppBar position="static" color="background">
            <Toolbar>
                <Typography variant="h6">
                    Slaughterhouse
                </Typography>
            </Toolbar>
        </AppBar>
    );
};

export default Navbar;
